import React from 'react';
import ReactDOM from 'react-dom';
import {HelmetProvider} from 'react-helmet-async';
import App from './App';

import 'bootstrap/dist/css/bootstrap.min.css';
import './index.css';

ReactDOM.render(
      <React.StrictMode>
        <HelmetProvider>
          <App />
        </HelmetProvider>
        </React.StrictMode>,
  document.getElementById('root')
);
